INSERT INTO `post` (`id`, `title`, `author`, `category`, `date`, `blog`, `upload_time`, `post_url`, `code`, `source`, `image_name`, `brief`) VALUES
(44, 'TikTok, UC Browser among 59 Chinese apps blocked as threat to sovereignty', 'admin', 'General', '2020-06-30', '&lt;font size=&quot;5&quot;&gt;New Delhi | Bengaluru: The government banned 59 Chinese mobile applications, including top social media platforms such as TikTok, Helo and WeChat, to counter the threat posed by these applications to the country&rsquo;s &ldquo;sovereignty and security,&rdquo; it said in a press release late on Monday. ShareIT, UC browser and shopping app Clubfactory are among the other prominent apps that have been blocked amid rising tensions between India and China following clashes at the border two weeks ago.&lt;/font&gt;&lt;br&gt;&lt;br&gt;&lt;div style=&quot;position: fixed; top: 0px; left: -99999px; background: rgb(255, 255, 255) none repeat scroll 0% 0%;&quot;&gt;New\r\n Delhi | Bengaluru: The government banned 59 Chinese mobile \r\napplications, including top social media platforms such as TikTok, Helo \r\nand WeChat, to counter the threat posed by these applications to the \r\ncountry&rsquo;s &ldquo;sovereignty and security,&rdquo; it said in a press release late on\r\n Monday. ShareIT, UC browser and shopping app Clubfactory are among the \r\nother prominent apps that have been blocked amid rising tensions between\r\n India and China following clashes at the border two weeks ago.\r\n&lt;br&gt;\r\n&lt;br&gt;The gov&amp;nbsp;.. &lt;br&gt;&lt;br&gt;&lt;div style=&quot;font-siae:12px;font-family:arial&quot;&gt;Read more at:&lt;br&gt;&lt;a href=&quot;https://economictimes.indiatimes.com/tech/software/india-bans-59-chinese-apps-including-tiktok-helo-wechat/articleshow/76694814.cms?utm_source=contentofinterest&amp;amp;utm_medium=text&amp;amp;utm_campaign=cppst&quot;&gt;https://economictimes.indiatimes.com/tech/software/india-bans-59-chinese-apps-including-tiktok-helo-wechat/articleshow/76694814.cms?utm_source=contentofinterest&amp;amp;utm_medium=text&amp;amp;utm_campaign=cppst&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;&lt;div style=&quot;position: fixed; top: 0px; left: -99999px; background: rgb(255, 255, 255) none repeat scroll 0% 0%;&quot;&gt;New\r\n Delhi | Bengaluru: The government banned 59 Chinese mobile \r\napplications, including top social media platforms such as TikTok, Helo \r\nand WeChat, to counter the threat posed by these applications to the \r\ncountry&rsquo;s &ldquo;sovereignty and security,&rdquo; it said in a press release late on\r\n Monday. ShareIT, UC browser and shopping app Clubfactory are among the \r\nother prominent apps that have been blocked amid rising tensions between\r\n India and China following clashes at the border two weeks ago.\r\n&lt;br&gt;\r\n&lt;br&gt;The gov&amp;nbsp;.. &lt;br&gt;&lt;br&gt;&lt;div style=&quot;font-siae:12px;font-family:arial&quot;&gt;Read more at:&lt;br&gt;&lt;a href=&quot;https://economictimes.indiatimes.com/tech/software/india-bans-59-chinese-apps-including-tiktok-helo-wechat/articleshow/76694814.cms?utm_source=contentofinterest&amp;amp;utm_medium=text&amp;amp;utm_campaign=cppst&quot;&gt;https://economictimes.indiatimes.com/tech/software/india-bans-59-chinese-apps-including-tiktok-helo-wechat/articleshow/76694814.cms?utm_source=contentofinterest&amp;amp;utm_medium=text&amp;amp;utm_campaign=cppst&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;&lt;div style=&quot;position: fixed; top: 0px; left: -99999px; background: rgb(255, 255, 255) none repeat scroll 0% 0%;&quot;&gt;NEW DELHI: A day before the third round of talks between Ind&amp;nbsp;.. &lt;br&gt;&lt;br&gt;&lt;div style=&quot;font-size:12px;font-family:arial&quot;&gt;Read more at:&lt;br&gt;&lt;a href=&quot;http://timesofindia.indiatimes.com/articleshow/76699679.cms?UTM_Source=Google_Newsstand&amp;amp;UTM_Campaign=RSS_Feed&amp;amp;UTM_Medium=Referral&amp;amp;utm_source=contentofinterest&amp;amp;utm_medium=text&amp;amp;utm_campaign=cppst&quot;&gt;http://timesofindia.indiatimes.com/articleshow/76699679.cms?UTM_Source=Google_Newsstand&amp;amp;UTM_Campaign=RSS_Feed&amp;amp;UTM_Medium=Referral&amp;amp;utm_source=contentofinterest&amp;amp;utm_medium=text&amp;amp;utm_campaign=cppst&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;', '05:59:48', 'TikTok-UC-Browser-among-59-Chinese-apps-blocked-as-threat-to-sovereignty', '', '', '', ''),
(46, 'BoycottNetflix Trends on Twitter Over Telugu Film Krishna and His Leela', 'admin', 'Entertainment', '2020-06-30', '#BoycottNetflix is trending on Twitter in India today as several users are not happy with a Telugu film Krishna and His Leela that dropped on Netflix last week. While the majority of tweets that are a part of #BoycottNetflix hashtag are memes making fun of the hashtag itself, some users said they were offended by the film and its characters who are named Krishna and Radha.&lt;br&gt;&lt;br&gt;References to any gods, deities, or religion have always been tricky subjects for films, books, and other media in India, and other countries as well. Such controversies are not limited to just gods and religions, even historical figures can be a reason for boycotts and protests. Padmaavat is one such example. The film became controversial during its production as several Rajput organisations, including Karni Sena, claimed that it portrayed Padmavati in bad light.&lt;br&gt;&lt;br&gt;', '06:05:37', 'BoycottNetflix-Trends-on-Twitter-Over-Telugu-Film-Krishna-and-His-Leela', '', '', '', ''),
(47, 'Covid-19 Unlock 2 will retain most curbs, curfew to be eased', 'admin', 'General', '2020-06-30', '&lt;font size=&quot;5&quot;&gt;&amp;nbsp;The Centre on Monday issued guidelines for the second of a three-phase plan aimed at lifting restrictions imposed to stop the spread of the coronavirus disease (Covid-19), announcing that educational institutions, Metro rail services and large gatherings will continue to remain banned, even as the night curfew was relaxed by an hour to aid economic activity.&lt;br&gt;&lt;br&gt;The Union home ministry released the plan, called Unlock 2, to open up more activities in areas outside containment zones, an official statement said. The new guidelines, which will come into effect from July 1, are based on feedback received from states, and consultations with central ministries and departments, it added. The current phase to ease restrictions, called Unlock 1, ends on Tuesday.&lt;/font&gt;&lt;br&gt;&lt;br&gt;', '06:11:18', 'Covid-19-Unlock-2-will-retain-most-curbs-curfew-to-be-eased', '', '', '', ''),
(53, 'TikTok CEOs Message To India Employees After Government Blocks App', 'admin', 'Global News', '2020-07-02', '&lt;h1&gt;TikTok CEO&amp;#39;s Message To India Employees After Government Blocks App&lt;/h1&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&amp;quot;We stay resolved and committed to our mission, and are working with stakeholders to address their concerns. TikTok continues to comply with all data privacy and security requirements under Indian law and places the highest importance on user privacy and integrity.&amp;quot;&lt;br /&gt;\r\n&lt;span style=&quot;color:#ecf0f1&quot;&gt;&lt;span style=&quot;background-color:#cc3300&quot;&gt;-Kevin Mayer, TikTok Chief Executive.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;figure class=&quot;easyimage easyimage-full&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;blob:http://localhost/6bac3b7e-c8d9-4507-8929-243dca678e4f&quot; width=&quot;580&quot; /&gt;\r\n&lt;figcaption&gt;&lt;/figcaption&gt;\r\n&lt;/figure&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '01:52:35', 'TikTok-CEOs-Message-To-India-Employees-After-Government-Blocks-App', '', '', '', '');
INSERT INTO `post` (`id`, `title`, `author`, `category`, `date`, `blog`, `upload_time`, `post_url`, `code`, `source`, `image_name`, `brief`) VALUES
(55, 'Guido van rosum', 'admin', 'Global News', '0000-00-00', '&lt;p&gt;&lt;img style=&quot;width: 25%;&quot; src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;guido-van-rossum-python-580x358.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;div class=&quot;b02-rich-text-plank__content share-initialized&quot;&gt;\r\n            &lt;div class=&quot;a01-text&quot;&gt;\r\n\r\n&lt;p&gt;Nothing defines the 21st century more than the ubiquitous effects of \r\ncomputer programming. Almost everything we do, particularly at work, is \r\nmediated by screens displaying the results of the enormous amount of \r\ncomputation that we now take for granted. If you&rsquo;re one of the 99.7% of \r\nthe human race that are not programmers, how all of this happens is a \r\nbit of a mystery. As science fiction writer Arthur C. Clarke quotably \r\nwrote, &ldquo;Any sufficiently advanced technology is indistinguishable from \r\nmagic.&rdquo;&lt;/p&gt;\r\n&lt;p&gt;Of course, it isn&rsquo;t magic. It is, however, both complicated and \r\ncomplex, with codebases of tech companies measured in millions of lines \r\nof code. When you&rsquo;re reasoning about a real system you might want to \r\nbuild in code, you&rsquo;re thinking about the complex relationships between \r\ndifferent functions over time. Your code can be more or less complicated\r\n in how it is written and structured, but the problem you\'re trying to \r\nsolve has an inherent complexity that can&rsquo;t be reduced to something \r\nsimpler.&nbsp;&lt;/p&gt;\r\n&lt;p&gt;Becoming a programmer is not just about ideas, and you won&rsquo;t last \r\nlong at it if you can&rsquo;t deal with the laser-focused details of \r\ndescribing your ideas in code. &ldquo;I\'m a little skeptical of the claim that\r\n the systems thinking is primary there, because it\'s much easier to come\r\n up with an idea for a system than it is to take an idea and turn it \r\ninto working code,&rdquo; says Guido van Rossum, the creator and retired BDFL \r\n(Benevolent Dictator for Life) of the Python programming language. \r\nJavaScript still owns the web, and Java runs 2.5 billion Android phones,\r\n but for general purpose programming and education, Python has become \r\nthe default standard.&lt;/p&gt;\r\n&lt;p&gt;If anyone has made turning an idea into working code easier, for more\r\n people, it&rsquo;s Van Rossum over his 30-year history with Python. And he&rsquo;s \r\ndone it with a self-effacing grace and an understated humor&mdash;the language\r\n is named after the surreal comedy of Monty Python, not the actual \r\nBurmese python. In its quiet way, the Python programming language has \r\nmanaged to make some of the complications of programming computers less \r\ndifficult for our brains to manage.&lt;/p&gt;\r\n&lt;p&gt;To understand how Van Rossum accomplished this amazing feat, we have \r\nto go back into the history of computing to the era of mainframes and \r\nmachine language. &ldquo;The mainframe is a machine that costs many millions \r\nof dollars, and the combined pay of all those programmers is peanuts \r\ncompared to the cost of the mainframe,&rdquo; he says, explaining that cost \r\nlogically prioritized machine time over human time. &ldquo;But as I \r\nexperienced desktop workstations and PCs, I realized that a change of \r\nmindset about cost of the programmer\'s time versus cost of the \r\ncomputer\'s time was overdue.&rdquo; Van Rossum doesn&rsquo;t think he was the first \r\nperson to observe this shift, but he really capitalized on it in the \r\ndesign of Python.&lt;/p&gt;&lt;br&gt;&lt;/div&gt;&lt;/div&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '11:37:10', 'Guido-van-rosum', '&lt;div data-height=&quot;auto&quot;&gt;\r\n        &lt;p&gt;\r\n        &lt;strong&gt;\r\n          &lt;a href=&quot;https://www.kialo.com/should-india-boycott-chinese-products-38210&quot;&gt;Should India Boycott Chinese Products?&lt;/a&gt;\r\n        &lt;/strong&gt; \r\n        &mdash;\r\n        &lt;a href=&quot;https://www.kialo.com/&quot;&gt;kialo.com&lt;/a&gt;\r\n      &lt;/p&gt;\r\n      &lt;script async src=\'https://www.kialo.com/assets/frontend-buildtag-stable-654/static/js/embedded-kialo.min.js\' charset=\'utf-8\'&gt;\r\n      &lt;/script&gt;\r\n      &lt;/div&gt;', 'https://www.python.org/\r\nhttps://www.python.org/\r\nhttps://www.python.org/', 'Guido van rosum', 'Nothing defines the 21st century more than the ubiquitous effects of computer programming. Almost everything we do, particularly at work, is mediated by screens displaying the results of the enormous amount of computation that we now take for granted. If you’re one of the 99.7% of the human race that are not programmers, how all of this happens is a bit of a mystery. As science fiction writer Arthur C. Clarke quotably wrote, “Any sufficiently advanced technology is indistinguishable from magic.”');
