(56, 'satellite image show china structure', 'admin', 'General', '2020-07-17', '&lt;p&gt;&lt;img style=&quot;width: 375px; height: 241.843px;&quot; src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;main-army-para-speci-032519015209-1592363848.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span class=&quot;ILfuVd&quot;&gt;&lt;span class=&quot;e24Kjd&quot;&gt;Galwan Valley: &lt;b&gt;Satellite images&lt;/b&gt; \'&lt;b&gt;show China structures&lt;/b&gt;\' on India border. &lt;b&gt;China&lt;/b&gt; has built new &lt;b&gt;structures&lt;/b&gt; near the site of a Himalayan border clash that left 20 Indian troops dead earlier this month, fresh &lt;b&gt;satellite images&lt;/b&gt; suggest. ... The fresh &lt;b&gt;satellite images&lt;/b&gt;, dated 22 June, are from space technology company Maxar.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '10:50:08', 'satellite-image-show-china-structure', '', 'https://www.bbc.com/news/world-asia-53174887', '', '');
